    <p>
        <button onclick="switchStylesheet()" class="button- bu1">style</button>
        <button id="dark-mode-button" class="button- bu2">Dark</button>
        <button id="light-mode-button" class="button- bu3">Light</button>
        <button class="scroll-to-top button- bu4">go top</button>
    </p>
    <script>
        var stylesheets = ["style1.css", "style2.css"];
        var currentStylesheet = 0;

        function switchStylesheet() {
        currentStylesheet = (currentStylesheet + 1) % stylesheets.length;
        var newStylesheet = stylesheets[currentStylesheet];

        var link = document.getElementsByTagName("link")[0];
        link.setAttribute("href", newStylesheet);
        }
    </script>
    <script>
        const darkModeButton = document.getElementById('dark-mode-button');
        const lightModeButton = document.getElementById('light-mode-button');

        darkModeButton.addEventListener('click', () => {
        document.body.classList.add('dark-mode');
        });

        lightModeButton.addEventListener('click', () => {
        document.body.classList.remove('dark-mode');
        });
    </script>
    <script>
        // Get all buttons with the .scroll-to-top class
        var btns = document.querySelectorAll(".scroll-to-top");

        // Loop through the buttons and add an onclick event that scrolls the page to the top
        for (var i = 0; i < btns.length; i++) {
        btns[i].onclick = function() {
            document.body.scrollTop = 0;
            document.documentElement.scrollTop = 0;
        };
        }
    </script>
